	redirect(){
		return <Redirect to="/fetch-data"/>
	}
	
	
	render() {
		return (
			<div>
				<h1>Авторизация</h1>
				<div>
					<b>Логин</b><input type="text"/>
				</div>
				<div>
					<b>Пароль</b><input type="text"/>
				</div>
				<div>
					<button onClick={()=>this.redirect()} className="btn btn-success">Авторизация</button>
				</div>
			</div>
		);
	}
}
